import React, { Component } from "react";
import { Link } from "react-router-dom";

class Transactions extends Component {
  render() {
    return (   
    <tr>
        <td>1</td>
        <td>1000000</td>
        <Link to="/transactiondetail"><td class="font-weight-bold">Detail</td></Link>
    </tr>

    );
  }
}

export default Transactions;
